(function () {
  'use strict';

  var Application = /** @class */ (function () {
      function Application(appName) {
          this.appName = appName;
      }
      Application.prototype.getName = function () {
          return this.appName;
      };
      return Application;
  }());

  var app = new Application("Wolverine app");
  document.getElementById("title").innerText = app.getName();

})();
